
function fnc_buscar_Nucleo_Imprimir() {
    hogar = txtHogar.GetText();
    identidad = txtTitular.GetText()
    if (hogar == "") {
        hogar = 0;
    }
    if (txtTitular.GetText() == "") {
        identidad = ""
    }
    // WaitMeEfect();
    $(".spinner").show()
    $.ajax({
        type: "post",
        url: "/Incorporaciones/Administracion/FormLayout_HogaresNucleos/",
        datatype: "json",
        data: { "hog_hogar": hogar, "titular": identidad },
        success: function (response) {
            //$("body").waitMe("hide")
            $(".spinner").hide()
            $("#hogar_impresion").empty()
            $("#hogar_impresion").append(response)
        }
    });
}





function fnc_exportarNucle_PDF(Hogar) {
    $.ajax({
        type: "post",
        url: "/Incorporaciones/Administracion/NucleoHogarJSON/",
        datatype: "json",
        data: { "hogar": Hogar },
        success: function (response) {
            var Datos = JSON.parse(response);
            var fonts = {
                Roboto: {
                    normal: 'fonts/Roboto-Regular.ttf',
                    bold: 'fonts/Roboto-Medium.ttf',
                    italics: 'fonts/Roboto-Italic.ttf',
                    bolditalics: 'fonts/Roboto-Italic.ttf'
                }
            };

            InfoMemo = [
                                    {
                                        text: 'PRESINDENCIA DE LA REPÚBLICA DE HONDURAS',
                                        style: 'subheader'
                                    },
                                    {
                                        text: 'SUBSECRETARIA DE INTEGRACIÓN SOCIAL / PRAF',
                                        style: 'quote',
                                    }

            ];

            var dd = {
                content: [
                               {
                                   columns: [{
                                       ul: [{
                                           image: "data:image/png;base64,",
                                           width: 100,
                                           height: 70,
                                           margin: [0, 0, 0, 0]
                                       }, ]
                                   },
                                            {
                                                ul: [{
                                                    image: "data:image/png;base64,",
                                                    width: 120,
                                                    height: 40,
                                                    margin: [130, 10, 0, 0]
                                                }, ]
                                            }
                                   ]
                               },
                                  InfoMemo,
                ],
                pageSize: 'LETTER',
                pageMargins: [15, 35, 15, 50],
                styles: {
                    subheader: {
                        fontSize: 10,
                        margin: [160, 0, 0, 10]
                    },
                    quote: {
                        italics: true,
                        fontSize: 9,
                        margin: [170, 0, 0, 10]
                    },
                    small: {
                        fontSize: 11
                    }
                }
            };

            var cuerpoTabla = [];
            $.each(Datos, function (s, e) {

                if (e["PER_TITULAR"] == 1) {
                    Es_Titular = "SI"
                } else {
                    Es_Titular = "NO"
                }
                cuerpoTabla.push({
                    "Nombre": e["NOMBRE"], "Identidad": e["PER_IDENTIDAD"], "Sexo": e["SEXOD"], "Fecha de Nacimiento": e["PER_FCH_NACIMIENTO"], "Titular": Es_Titular, "Estado": e["PER_ESTADO_DESCRIPCION"]
                });
            });
            dd.content.push(
                        tableEn(
                                    Datos[0].DESC_DEPARTAMENTO, Datos[0].DESC_MUNICIPIO, Datos[0].DESC_ALDEA, Datos[0].DESC_CASERIO, Datos[0].HOGAR_DIRECCION,
                                    Datos[0].HOG_HOGAR, Datos[0].HOG_TELEFONO
                                ))
            dd.content.push(
                              table(cuerpoTabla, ["Nombre", "Identidad", "Sexo", "Fecha de Nacimiento", "Titular", "Estado"], 0, ['*', 100, 50, 50, 50, 40], 3)
                            );

            pdfMake.createPdf(dd).download("Hogar_" + Datos[0].HOG_HOGAR.toString() + ".pdf");
        },

        error: function (jqXHR, textStatus, errorThrown) {
            $("body").waitMe("hide")
        }
    }).fail(function (jqXHR, textStatus, errorThrown) {
        $("body").waitMe("hide")
    });
}




function table(data, columns, total, celdas, tipo) {
    return {
        text: 'noBorders:', fontSize: 8, bold: true, margin: [0, 2, 2, 0],
        table: {
            headerRows: 1,
            widths: celdas,
            body: buildTableBody(data, columns, total, tipo)
        }
    };
}



