function buildTableBody(data, columns, total, tipo) {

    var body = [];
    if (tipo == 3) {
        body.push([{ text: 'DATOS GENERALES DE LOS MIEMBROS DEL HOGAR', style: 'tableHeader', colSpan: 6, alignment: 'center' }, {}, {}, {}, {}, {}])
    }

    body.push(columns);

    data.forEach(function (row) {
        var dataRow = [];

        columns.forEach(function (column) {
            dataRow.push(row[column].toString());
        })

        body.push(dataRow);
    });

    if (tipo == 1) {
        var fila = [{ colSpan: 10, rowSpan: 1, text: 'Total de fichas :      ' + total }, '']

    } else if (tipo == 2) {
        var fila = [{ colSpan: 12, rowSpan: 1, text: 'Total de fichas :      ' + total }, '']
    }

    if (tipo != 3) {
        body.push(fila);
    } else {
        body.push([ { text: 'Elegibilidad', style: 'tableHeader', alignment: 'center', margin: [0, 5, 5, 8] },
                    { text: 'Observaciones', style: 'tableHeader', colSpan: 5, alignment: 'center' }, {}, {}, {}, {}],
                  [{ text: '', style: 'tableHeader', alignment: 'center', rowSpan: 4 },
                   { text: '', style: 'tableHeader', colSpan: 5, alignment: 'center', rowSpan: 11 }, {}, {}, {}, {}],
                  ['', '', '', '', '', ''],
                  ['', '', '', '', '', ''],
                  ['', '', '', '', '', ''],
                  [{ text: 'Solo Mayores de Catorce', style: 'tableHeader', alignment: 'center' },
                    '', '', '', '', ''],
                  [{ text: '', style: 'tableHeader', alignment: 'center', rowSpan: 6 },
                    '', '', '', '', ''],
                  ['',
                    '', '', '', '', ''],
                  ['',
                    '', '', '', '', ''],
                  ['',
                    '', '', '', '', ''],
                  ['',
                     '', '', '', '', ''],
                  ['',
                    '', '', '', '', ''],
                  [{ text: 'Firma y Huella del Titular', style: 'tableHeader', alignment: 'center' },
                   { text: 'Firma y Huella del Promotor', style: 'tableHeader', colSpan: 5, alignment: 'center' }, {}, {}, {}, {}],
                  [{ text: '', style: 'tableHeader', alignment: 'center', rowSpan: 8 },
                  { text: '', style: 'tableHeader', colSpan: 5, alignment: 'center', rowSpan: 8 }, {}, {}, {}],
                  ['', '', '', '', '', ''],
                  ['', '', '', '', '', ''],
                  ['', '', '', '', '', ''],
                  ['', '', '', '', '', ''],
                  ['', '', '', '', '', ''],
                  ['', '', '', '', '', ''],
                  ['', '', '', '', '', '']
             )
    }

    return body;
}




